import React from "react";
import Icon from "./image/cropped-91-Club-Official-Favicon.webp";
import Image1 from "./image/cropped-91-Club-Official-Favicon.webp";
import Image2 from "./image/91_Club_K3_Lotre_Number_Prediction_Game.webp";
import Image3 from "./image/91_Club_TRX_Hash_Colour_Prediction_Game.webp";
import Image4 from "./image/91_Club_Wingo_Colour_Prediction_Game.webp";

const Content =() => {
    const image = [
        { id:1, image1 : Image1, alt: "image1"},
        { id:2, image2 : Image2, alt: "image2" },
        { id:3, image3 : Image3, alt: "image3" },
        { id:4, image4 : Image4, alt: "image4" },

    ]
    return(
        <div className="container">
            <div className="row">
                     <img src={Icon} alt="icon" description=" 91 club | icon" className="img-fluid"/>
                     <h1 className="text-center"> 91 Club Official</h1>
            </div>
            {image.map(images => (
                     <div className="row">
                     <div className="col">
                     <img src={image.src} key={images.id} className="img-fluid" alt={image.alt}  />
                     </div>
                 </div>
                ))}
            <div className="row">
                <div className="col">1</div>
                <div className="col">2</div>
            </div>
            <div className="row">
                <div className="col">3</div>
                <div className="col">4</div>
            </div>
            <div className="row">
                <button>1</button>
                <button>2</button>
                <button>3</button>
                <button>4</button>
                <button>5</button>
            </div>
        </div>
    )

}

export default Content;
